Yes, it is possible to add a caption to an image in HTML. To do so, you can use the `<img>` tag and set the `alt` attribute to the desired caption. For example: `<img src="image-url" alt="Caption text">`. The `alt` attribute is used to describe the image to screen readers and search engines. This way, even if the image cannot be displayed, the caption will still be visible.

It is also possible to add a caption to an image in CSS by using the `::before` and `::after` pseudo-elements. For example, you could use the following CSS code to add a caption to an image:
```
img {
  position: relative;
  padding-bottom: 50%;
  border: 1px solid #ddd;
  margin: 1em auto;
  width: 100%;
}

img::before {
  content: attr(alt);
  position: absolute;
  top: 0;
  left: 0;
  background: #fff;
  padding: 1em;
  border: 1px solid #ddd;
  width: 100%;
}
```
